import React from 'react';
import Button from 'react-bootstrap/Button';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import { Nav } from 'react-bootstrap';
import {NavDropdown} from 'react-bootstrap';



const renderTooltip = props => (
  <div
    {...props}
    style={{
      
      padding: '2px 10px',
      color: 'rgba(0,0,0,.5)',
      borderRadius: 3,
      ...props.style,
    }}
  >
    <ul>
        <Nav.Link href="http://cholvie.com/" target="blank">Contact</Nav.Link>
        <li href="cholvie.com">sandalwood</li>
        <li href="cholvie.com">vanilla</li>
        <li href="cholvie.com"> amber</li>
        <li href="cholvie.com">patchouli</li>
        <li href="cholvie.com">oakmoss</li>
        <li href="cholvie.com">musk</li>
    </ul>

    
    <NavDropdown title="Notes" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.4">Sign In</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.1">Your Account</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Wish List</NavDropdown.Item>
    </NavDropdown>
  
  </div>  
);

const Notes = () => (
  <OverlayTrigger
    placement="bottom-start"
    delay={{ show: 250, hide: 4000 }}
    overlay={renderTooltip}
  >
    <NavDropdown variant="success">Hover me to see</NavDropdown>
  </OverlayTrigger>
);

export default Notes;
